        private ImageSource internalSource;
        private DesignType currentDesignType;
        private ColorUI currentColor;
        private Position currentPosition;

        /// <summary>
        /// Constructor of TitleImage
        /// </summary>
        /// <param name="hash"></param>
        /// <param name="color"></param>
        /// <param name="designType"></param>
        /// <param name="position"></param>
        public TitleImage(string hash, DesignType designType, ColorUI color, Position position)
        {
            if (hash != "__Laavor*+-///qwertyuiiii23444UUUU+=@33%%*&¨VVVMMad13,a,a8d939kl")
            {
                throw new Exception("Key in Invalid in Constructor");
            }

            currentDesignType = designType;
            currentColor = color;
            currentPosition = position;

            Aspect = Aspect.Fill;
            HorizontalOptions = LayoutOptions.Start;
            VerticalOptions = LayoutOptions.Center;

            byte[] imageBytes = Convert.FromBase64String(GetColor(designType, color, currentPosition));
            var streamImage = new System.IO.MemoryStream(imageBytes);

            this.internalSource = ImageSource.FromStream(() => streamImage);
            Source = internalSource;
        }

        /// <summary>
        /// Change ColorUI of Button
        /// </summary>
        /// <param name="hash"></param>
        /// <param name="color"></param>
        public void ChangeColor(string hash, ColorUI color)
        {
            if (hash != "__Laavor*+-///qwertyuiiii23444UUUU+=@33%%*&¨VVVMMad13,a,a8d939kl")
            {
                throw new Exception("Key in Invalid in ChangeColor");
            }

            currentColor = color;

            byte[] imageBytes = Convert.FromBase64String(GetColor(currentDesignType, color, currentPosition));
            var streamImage = new System.IO.MemoryStream(imageBytes);

            this.internalSource = ImageSource.FromStream(() => streamImage);
            Source = internalSource;
        }

        /// <summary>
        /// Change DesignType of Title
        /// </summary>
        /// <param name="hash"></param>
        /// <param name="designType"></param>
