            }

            currentPosition = position;

            byte[] imageBytes = Convert.FromBase64String(GetColor(currentDesignType, currentColor, currentPosition));
            var streamImage = new System.IO.MemoryStream(imageBytes);

            this.internalSource = ImageSource.FromStream(() => streamImage);
            Source = internalSource;
        }

        private string GetColor(DesignType design, ColorUI color, Position position)
        {
            if (design == DesignType.Ribbon)
            {
                MethodInfo methodToInvoke = this.GetType().GetMethod("GetImage" + design.ToString() + position.ToString(), BindingFlags.NonPublic | BindingFlags.Instance);

                object[] parametersInvoke = { color };

                var returnStringColor = (string)methodToInvoke.Invoke(this, parametersInvoke);
                return returnStringColor;
            }
            else
            {
                MethodInfo methodToInvoke = this.GetType().GetMethod("GetImage" + design.ToString(), BindingFlags.NonPublic | BindingFlags.Instance);

                object[] parametersInvoke = { color };

                var returnStringColor = (string)methodToInvoke.Invoke(this, parametersInvoke);
                return returnStringColor;
            }
        }

